import React from "react";
import "../../style.css";

function Nav(props) {
  return (
    <div className="navbar-container">
      <nav className="navbar navbar-expand-lg navbar-dark b-navbar">
        <div className="b-navbarNavDropdown" id="navbarNavDropdown">
          <ul className="navbar-nav b-navbarnav">
            <li className="nav-item b-nav-item active">
              <a className="nav-link b-nav-link" href="/">Home <span class="sr-only">(current)</span></a>
            </li>
            <li className="nav-item b-nav-item">
              <a className="nav-link b-nav-link" href="/requests">Signup</a>
            </li>
            <li className="nav-item b-nav-item">
              <a className="nav-link b-nav-link" href="/calendar">Calendar</a>
            </li>
          </ul>
        </div>   
      </nav>
    </div>
  );
}

export default Nav;
